    const auth = UseAuth();
    const location = useLocation();

    return (
        /*  <Route exact={props.exact} path={props.path} component={props.component}> */     
        <Route {...rest}>
            {auth.isLogged() ?
                (<Component />)
                :
                (<Redirect to="/login"/>)            }
        </Route>
    );
}
